import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

function App() {
    return (
        <div>
            <Navbar />
            <main>
                <h1>Welcome to My Portfolio</h1>
                <p>This is where your journey begins!</p>
            </main>
            <Footer />
        </div>
    );
}

export default App;
